import React, { useState } from 'react';
import Dialog from '@mui/material/Dialog';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import DialogActions from '@mui/material/DialogActions';
import Button from '@mui/material/Button';
import EditIcon from '@mui/icons-material/Edit';

const ProfileEditDialog = () => {
  const [open, setOpen] = useState(false);

  const handleOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleSaveChanges = () => {
    // Implement your logic to save changes here
    // This function will be called when the "Save Changes" button is clicked
    setOpen(false);
  };

  return (
    <div>
      <button className="editButton" onClick={handleOpen}>
        Edit Profile&nbsp;<EditIcon />
      </button>
      <Dialog open={open} onClose={handleClose}>
        <div className="dialogTitle">Edit Profile</div>
        <DialogContent>
          {/* Include form fields for editing user profile */}
          <form>
            {/* Example input field */}
            <label>Username</label>
            <input type="text" placeholder="Enter new username" />
          </form>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleSaveChanges} variant="contained">
            Save Changes
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
};

export default ProfileEditDialog;
